import { Button, SxProps, Theme, Typography, Box } from "@mui/material";
import { useNavigate } from "react-router-dom";
import backgroundImage from './background.avif';
import { useState } from "react";


function AddInventories() {

    const navigation = useNavigate();

    const handleNavigation = () =>{
        navigation('/AddInventories');
    }

    const wholeConInventories: SxProps<Theme> = {
        minHeight: '100vh',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        backgroundImage: `url(${backgroundImage})`,
        backgroundSize: 'cover', 
        backgroundPosition: 'center', 
        minWidth: '800px',
    }

    const headerInventories: SxProps<Theme> = {
        display: 'flex',
        justifyContent: 'center',
        fontFamily: 'Times New Roman, Times, serif',
        fontSize: 'x-large',
    }

    const container: SxProps<Theme> = {
        display: 'flex',
        width: '1000px',
        flexDirection: 'column',
        justifyContent:'center',
        flex:1,
        marginTop:-20,
    }

    const bodyInventories: SxProps<Theme> = {
        display: 'flex',
        flexDirection: 'row',
        backgroundColor:'red'
    }

    const body1: SxProps<Theme> = {
        display: 'flex',
        flex: 1,
        alignItems: 'center',
        fontFamily:'timesnewroman',
        fontSize:'18px',
        backgroundColor:'red'
    }

    const body2: SxProps<Theme> = {
        display: 'flex',
        flex: 1,
        alignItems: 'center',
    }

    const inventoriesDetails: SxProps<Theme> = {
        marginTop:'20px',
        marginLeft:'20px',
        fontFamily:'TimesNewRoman',
        display:'flex',
        flexDirection:'column',
    }

    const inventoriesDetailsPart : SxProps<Theme> = {
        display: 'flex',
        flexDirection: 'row',
    }

    const inventoriesDetails1: SxProps<Theme> = {
        display:'flex',
        flex: 1,
        alignItems:'center',
        fontSize: 'large',
    }

    const inventoriesDetails2: SxProps<Theme> = {
        display:'flex',
        flex:1,
        alignItems:'center',
    }

    const submitButton : SxProps<Theme> = {
        display:'flex',
        justifyContent:'center',
        alignItems:'center',
        minHeight:'10vh'
    }

    return (
        <Box sx={wholeConInventories}>
            <Box sx={headerInventories}>
                <h2>HERE YOU CAN ADD THE SHOPS</h2>
            </Box>
            <Box sx={container}>
                <Box sx={bodyInventories}>
                    <Box sx={body1}><label>ENTER THE SHOP NAME      : </label></Box>
                    <Box sx={body2}><input type='text'></input></Box><br /><br /><br /><br />
                </Box>
                <Box sx={bodyInventories}>
                    <Box sx={body1}>ENTER THE SHOPLOCATION :</Box>
                    <Box sx={body2}><input type='text'></input></Box><br /><br /><br /><br />
                </Box>
                <Box sx = {submitButton}><Button onClick={handleNavigation} variant="contained">ADD SHOPS</Button></Box>
            </Box>
        </Box>
    )
}
export default AddInventories
